css:
@-moz-document domain("vicsig.net") {
body {
    font-family: century gothic;
    font-size: 12px;
    color: black;
    background-color: white;
    margin: 0;
    padding: 0px;
    text-align: center;
}
h1 {
    background: gray !important;
}
.h1left, .h1right {
    background: gray !important;
}

a:link {
    color: #00a4d8;
}
a:visited{
    color: #00a4d8;
}
/* Full Width */
#pagewidth {
    /*[[width]]*/
}
/* Head */
#headerleft, #headerright, #header{
    background:#cacaca;
}

img[src*="left"]{
    width:0;
    height:70px;
    padding-right:250px;
    background:transparent url(data:image/png;base64,) top left no-repeat;
}
img[src*="right"]{
    width:0;
    height:70px;
    padding-right:250px;
    background:none;
}
/* Col */
#maincol {
    margin-left: 130px;
    padding: 0px;
    border-right: 1px solid grey;
    border-left: 1px solid grey;
}
#leftcol {
    float: left;
    width: 130px;
    margin: 0;
    padding: 0px 0px 0 0; 
    border-right: 1px solid grey;
}
#rightcol {
    padding: 0px 0 0 0px; 
}
/* Nav */
#nav ul {
    margin: 0 0 0px;
    border: 0px solid black; 
    font-weight: normal;
    cursor: pointer;
}
#nav ul ul {
    padding: 0 0 0px;
    font-size: 14px;
    font-weight: normal;
}
#nav ul ul ul {
    margin: 0 0 0px;
    text-indent: 6px;
}
#nav a:hover {
    text-decoration: underline;
    background: none;
}
#navcurr {
    background: #f5f5f5;
}
#navimagerail {
    background: #00a4d8;
}
#navimagetram {
    background: #87f87c;
}
#navimageinteraction{
    background: #e45757
}
#navimagecommunity {
    background: #d4e607;
}
#navcommunity li a {
    color: #768605;
}

/* Right Home Col */
.rightinfo h1 {
    background-color: grey;
    font-size: 15px;
    color: white;
}
/* Footer */
.clr{
	height:0px;
}
#footer {
    margin-left: 0px;
}
#footermain {
    margin-top: 0px;
    margin-bottom: 0px;
    background: black 100% 0 repeat-x;
    padding: 3px;
    color: white;
}
#stats {
    background: grey;
    color: white;
    height: 16px;
    padding-left: 4px;
    font-size: small;
}
}

@-moz-document url-prefix("http://vicsig.net/index.php?page=passenger") {
#navimagerail {
    background: #b95cd2;
}
#navrail li a {
    color: #813e93;
}
}
